INSERT INTO `section` VALUES ('61', '42', 'SECTION J: IMMUNIZATION', 'This section relates to the history of immunization for the child. The immunization history of the selected child will be recorded. Preference will be given to the information from an immunization card; however, in case an immunization card is not available, then verbal history will be taken from the respondent. In case you have problems in understanding the card, please take a picture of the card and discuss with your supervisor. Please refer to the training manual for further instructions. The child between the ages of 12 to 23 will be randomly picked from the household member list. If there is more than one child, then among the eligible ones, one is randomly picked.', 'SECTION J: IMMUNIZATION', 'This section relates to the history of immunization for the child. The immunization history of the selected child will be recorded. Preference will be given to the information from an immunization card; however, in case an immunization card is not available, then verbal history will be taken from the respondent. In case you have problems in understanding the card, please take a picture of the card and discuss with your supervisor. Please refer to the training manual for further instructions. The child between the ages of 12 to 23 will be randomly picked from the household member list. If there is more than one child, then among the eligible ones, one is randomly picked.', null, null, null, null, null, null, null, null, 'J', 'Ongoing', 'immunization', '26', '14', '');
